import React from 'react';
import { Form, Input } from 'antd';

const dummy = {
    isLoggedIn: true,
};

const Home = () => {
    return(
        <div>
            {dummy.isLoggedIn && <Form encType='multipart/form-data'>
                <Input.TextArea maxLength={140} placeholder='set me up!!' />
            </Form>
            
            }
        </div>
    );
};

export default Home;
